DataUL17_Analyzer_NANO_AOD_with_LepJetClean::DataUL17_Analyzer_NANO_AOD_with_LepJetClean(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("Data2017_B.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("Data2017_B.root");
      }
      f->GetObject("Events",tree);

   }
   Init(tree);
}

DataUL17_Analyzer_NANO_AOD_with_LepJetClean::~DataUL17_Analyzer_NANO_AOD_with_LepJetClean()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t DataUL17_Analyzer_NANO_AOD_with_LepJetClean::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t DataUL17_Analyzer_NANO_AOD_with_LepJetClean::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

